INSERT INTO `edu_teacher` VALUES ('1', '张三', '近年主持国家自然科学基金（6项）、江苏省重大科技成果转化项目（5项）、江苏省产学研前瞻性联合研究项目（3项）、省工业科技支撑、省高技术、省自然科学基金等省部级及其企业的主要科研项目40多个，多个项目在企业成功转化，产生了较好的经济、社会和环境效益。积极开展产学研科技合作，并与省内16家企业建立了江苏省研究生工作站，其中6家为江苏省优秀研究生工作站', '高级', 1, 'https://edu-wangzhan.oss-cn-shenzhen.aliyuncs.com/2020/06/01/49788a2bf946443e959998bca568cfd4file.png', 0, 0, '2019-10-30 14:18:46', '2019-11-12 13:36:36');
